import React, { Component } from "react";


class Language extends Component{
test(){
}
render() {
  
    return (
        
        <div>
          
        <div className="skill-container" style={{display:"flex",justifyContent:"space-between"}}>
            <div>
                <p style={{textTransform:"capitalize"}}>{this.props.skill}
                    <br></br>
                {this.props.level}
                </p>
               
            </div>

          
            
        </div>
        
        <hr></hr>
       
    </div>
    )
}
}
export default Language
